import './Admin.css'


const Admin = () => {
  return (
    <div className='AdminContainer'>
      <div>
        <h1>Admin page</h1>
        <button>Add new gig</button>
        <button>Edit gig</button>
        <button>Delete gig</button>
        </div>
    </div>
    );
  };
  
  export default Admin;
